import React from "react";
import Cards from "./Cards";
import img1 from "./images/img1";
import img2 from "./images/img2";
import img3 from "./images/img3";
import img4 from "./images/img4";
import img5 from "./images/img5";
import img6 from "./images/img6";
import img7 from "./images/img7";
import img8 from "./images/img8";
const Professional = () => {
    return (
        <main className="professionalPage">
            Professional
            <h3>Live Events</h3>
            <div className="liveEvents">
                <Cards src={img1} />
                <Cards src={img2} />
                <Cards src={img3} />
                <Cards src={img4} />
            </div>
            <h3>Upcoming Events</h3>
            <div className="upcomingEvents">
                <Cards src={img5} />
                <Cards src={img6} />
                <Cards src={img7} />
                <Cards src={img8} />
            </div>
            <h3>Past Events</h3>
        </main>
    );
};

export default Professional;
